INSERT INTO Leccion VALUES(1210,"1.2.1 Prueba de bondad de ajuste", 1, 0,
'{"contenido":[
"Esta prueba se utiliza para determinar si una distribución teórica y una distribución empírica se ajustan y conocer si las frecuencias esperadas difieren de las obtenidas.",
"Supóngase que en una muestra determinada se observa la ocurrencia de un conjunto de eventos E1, E2, E3, . . ., Ek con las frecuencias o1, o2, o3, . . ., ok, llamadas frecuencias observadas y que, según las reglas de la probabilidad, se esperaría que estos eventos ocurrieran con frecuencias e1, e2, e3, . . ., ek, llamadas frecuencias espera das o teóricas. Se desea saber si las frecuencias observadas difieren, de manera significativa, de las frecuencias esperadas.-M. R. Spiegel y L. J. Stephens, Probabilidad y estadística, Mc Graw Hill, 2009.",
"|\/||\/|"
]}');
