INSERT INTO Leccion VALUES(2330,"2.3.3 Evaluación y diagnósticos", 1, 0,
'{"contenido":[
"Se usa ANOVA para cada coeficiente, para el diagnóstico residual y delineadores se usan graficas residuales vs graficas Q-Q.",
