]}');
INSERT INTO Leccion VALUES(2340,"2.3.4 Selección variable", 1, 0,
'{"contenido":[
"Algunas consideraciones para aplicar la regresión lineal múltiple es cuantas variables y que variables X_j^  se usaran.",
"Selección hacia atrás:",
"Se incluyen todas las variables y después se va eliminando la secuencia de variables revisando una reducción significante de R_^2",
"Selección hacia adelante:",
"Se empieza con la X que más afecte a la variable Y. se van agregando las variables independientes.",
"Selección paso a paso:",
"Se sueltan y se agregan variables en selección tanto hacia adelante como hacia atrás, cada que se agregan variables se revisa si se puede quitar alguna variable previamente agregada, este proceso se puede automatizar usando métricas que describan que tan buena fue la selección",
"La estadística de Mallows’Cp o el criterio de información de Akaike (AIC) se usan para decidir que variable puede ser descartada o agregada y además como guía para el proceso de ensayo y error.",
"Mallows’Cp se calcula de para un subconjunto de datos de p variables de m variables independientes",
"|\/||\/|",
"El criterio de información Akaike se basa en dos conceptos, función de verosimilitud y contenido de información",
"Función de verosimilitud: aplica tanto para variables discretas como continuas aleatorias",
"|\/||\/|",
"El contenido de información o entropía de una variable aleatoria discreta",
"|\/||\/|",
"Por lo que podemos seguir con la definición de AIC",
"|\/||\/|",
"Donde r es el número de variables y L es la función de verosimilitud maximizada del modelo de regresión para r variables.",
"Esta expresion consta de dos partes, un costo positivo 2r y un beneficio negativo 2In(L) derivado de la bondad de ajuste.",
"Cp y AIC pueden ser usados en un proceso paso por paso o iterativo además cuando el numero de observaciones es menor o hay muchas variables se corrige el AIC agregando el factor 2r(r+1)(n-r-1) para penalizar con un costo extra de usar muchas variables cuando n es menor."
]}');
