]}');
INSERT INTO Leccion VALUES(4110,"4.1.1 Prueba de patrones uniformes", 1, 0,
'{"contenido":[
"Utilizado para evaluar si los eventos se encuentran distribuidos de manera uniforme en un área específica, el procedimiento consiste en:",
"*Definir el área de estudio",
"*Dividir en celdas del mismo tamaño",
"*Registrar los eventos por celda",
"*Cálculo de media y varianza (Análisis de patrones) donde si la varianza es similar a la media hay un patrón uniforme",
"*Aplicas alguna prueba estadística como Chi-cuadrada"
]}');
INSERT INTO Leccion VALUES(4120,"4.1.2 Pruebas de aleatoriedad espacial", 1, 0,
'{
    "contenido": [
        "Se usan para determinar si la distribución de eventos sigue un patrón aleatorio. Las pruebas más comunes son:",
        "*Chi-cuadrada (Comparar la distribución con un modelo aleatorio)",
        "*Índice de Morista (Agregación de eventos en un área)",
        "*KNN (Evaluar puntos en función de la distancia de sus vecinos más cercanos)",
        "*Monte Carlo (Simular múltiples distribuciones para comparar con la distribución observada)"
    ]
}');
INSERT INTO Leccion VALUES(4130,"4.1.3  Patrones agrupados", 1, 0,
'{"contenido":[
"Se refiere a una distribución en donde las entidades tienden a agruparse esto siendo causado por diversos factores.",
"Esto se puede determinar a partir del Índice de Morita, Prueba Chi-cuadrada, K-vecinos más cercanos.",
"Ejemplos de patrones agrupados:",
"*Colonias de especies",
"*Distribución de enfermedades",
"*Negocios",
"*Planificación urbana"
]}');
INSERT INTO Leccion VALUES(4200,"4.2 Análisis del vecino más cercano", 1, 0,
'{"contenido":[
"Técnica estadística para evaluar la distribución espacial que tienen los puntos en un área determinada."
]}');
INSERT INTO Leccion VALUES(4210,"4.2.1 Análisis de primer orden", 1, 0,
'{"contenido":[
"*Defines el área de estudio",
"*Recolectas los datos mediante coordenadas (x,y)",
"*Calculas la distancia euclidiana entre los puntos o vecinos",
"*Calculas la media de las distancias",
"*Generas puntos aleatorios en el área y repites el proceso"
]}');
INSERT INTO Leccion VALUES(4220,"4.2.2 Análisis de segundo orden", 1, 0,
'{"contenido":[
"Aquí también se evalúan las interacciones y patrones entre los puntos con los que es posible determinar patrones de agrupamiento y dispersión",
"Los métodos de análisis de segundo orden son:",
"*Función K de Ripley la cual mide la densidad de eventos en función de la distancia comparada la densidad observada con la esperada",
"|\/||\/|",
"*Función L de Ripley es una transformación de la función K con una escala normalizada facilitando su interpretación",
"|\/||\/|",
"*Análisis de distribución de distancias"
]}');
INSERT INTO Leccion VALUES(4300,"4.3 Patrones de puntos marcados ", 1, 0,
'{"contenido":[
